// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract TwinStaking is Ownable, ReentrancyGuard {

   IERC20 public twinToken;

   uint public poolStatus;  // 0 - Close / 1 - Open
   uint public maxTwinInPool;
   uint public percentageRate;  // percentage in maturity period   // represented in 1e10
   uint public percentPerDay;
   uint public maturityPeriod;  // Period in seconds
   uint public totalStakedAmount;

   mapping(address => uint) public userToStakeAmount;
   mapping(address => uint) public userToStakeStart;
   mapping(address => uint) public userHasStaked;  // 0 - False / 1 - true;
   mapping(address => uint) public isAdmin; // 0 -False / 1 - true;


   constructor(address _twinToken, address _admin) {
        twinToken = IERC20(_twinToken);
        maxTwinInPool = 1000000 * 1e18;
        poolStatus = 1;
        isAdmin[_admin] = 1;
        maturityPeriod =  2592000;// 30 days in seconds
        percentageRate = 500000000000; // 
        percentPerDay = 1369863013;

   }

   function changePoolStatus(uint _status) public {
      require(isAdmin[msg.sender] == 1);
      poolStatus = _status;
   }   

   function changeAPY(uint _apy) public returns(uint)  { // 1e10
      require(isAdmin[msg.sender] == 1);
      percentPerDay = _apy / 365;
      uint ratePerMaturity = percentPerDay * (maturityPeriod / 86400);
      percentageRate = ratePerMaturity;

      return percentageRate;

   }


   function changeMaturityPeriod(uint _period) public { // represented in seconds
      require(isAdmin[msg.sender] == 1);
      maturityPeriod = _period;
      uint ratePerMaturity = percentPerDay * (maturityPeriod / 86400);
      percentageRate = ratePerMaturity;

   }

   function depositTwin(uint _amount) public  {
        require(isAdmin[msg.sender] == 1);
        twinToken.transferFrom(msg.sender, address(this), _amount);
   }

   function withdrawTwin() public  {  
        require(isAdmin[msg.sender] == 1);
        uint twinBalance = twinToken.balanceOf(address(this));
        twinToken.transfer(msg.sender, twinBalance);
   }

   function stakeToken(uint _amount) public nonReentrant {
       require(poolStatus == 1);
       uint balance = twinToken.balanceOf(address(this));
       require(balance <= maxTwinInPool, "Pool at max capacity!");
       require(_amount > 0, "Amount cannot be zero");

       if(userHasStaked[msg.sender] == 0) {
          userHasStaked[msg.sender] = 1;
          userToStakeStart[msg.sender] = block.timestamp;
       }

       userToStakeAmount[msg.sender] = userToStakeAmount[msg.sender] + _amount;
       totalStakedAmount = totalStakedAmount + _amount;

       twinToken.transferFrom(msg.sender, address(this), _amount);

   }

   function unstakeToken() public nonReentrant {
       require(poolStatus == 1);
       require(userToStakeAmount[msg.sender] > 0, "no staked token");
       uint stakedAmount = userToStakeAmount[msg.sender];
       uint resedualRewards = checkRewardCycle(msg.sender);
       userToStakeAmount[msg.sender] = 0;
       userHasStaked[msg.sender] = 0;
       userToStakeStart[msg.sender] = 0;
       totalStakedAmount = totalStakedAmount - stakedAmount;
       twinToken.transfer(msg.sender, (stakedAmount + resedualRewards));
   }

   function claimRewards() public nonReentrant {
      require(poolStatus == 1);
      uint reward = checkRewardCycle(msg.sender);
      require(reward > 0, "There is nothing to claim!");

      twinToken.transfer(msg.sender, reward);

      userToStakeStart[msg.sender] = block.timestamp;  //reset stake time after claim rewards

   }

   function checkRewardCycle(address _user) public view returns(uint) {
      uint timeDifference = block.timestamp - userToStakeStart[_user]; // timeDifference in seconds 

      uint userRewardCycle = timeDifference / maturityPeriod;    

      uint userRewardPoints = (percentageRate * userRewardCycle);  

      uint userReward = (userRewardPoints * userToStakeAmount[_user]) / 1e12;  
      return userReward;


   }

   function getPoolStatus() public view returns(uint) {
      return poolStatus;
   }

   function getUserStakeAmount(address _user) public view returns(uint) {
      return userToStakeAmount[_user];
   }

   function getMaturityPeriod() public view returns(uint) {
      return maturityPeriod;
   }

   function getTotalStakedinPool() public view returns(uint) {
      return totalStakedAmount;
   }





}
